import React from 'react';
import './modalWindowChooseTheme.css'
function ModalWindowChooseTheme(props) {
    function renderTheme() {
        //console.log(props.themes);
        return props.themes.map(item =>{
            let listWords = item.list.map(word => {
                console.log(word);
                return(
                    <li><p>{word.word}</p></li>
                )
            });
            return(
                <li><p>{item.name}</p>
                    <ul>
                        {listWords}
                    </ul>
                </li>
            )
        })
    }
    return (
        <div id="block">
            {renderTheme()[0]}
            <nav>
                <button onClick={() => console.log(renderTheme())}>x</button>
